package Week_5;

public class encapsulation {
    private String name;
    private int id;
    private double percentage;

    public String getNameString() {
        return name;
    }

    public void setNameString() {
        this.name = name;
    }

    public int getId() {
        return id;
    }

    public void setId() {
        this.id = id;
    }

    public double getPercentage() {
        return percentage;
    }

    public void setPercentage() {
        this.percentage = percentage;
    }
}
